import styled from "styled-components";
import '../App.css';

const HeaderContainer = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`

const PersonalArea = styled.div`
  background-color: #7A66CC;
  p{
    margin: 15px;
    color: white;
    font-size: 20px;
    font-weight: normal;
  }
`

const Header = () => {
  return (
    <HeaderContainer>
      <PersonalArea>
        <p>Личный кабинет</p>
      </PersonalArea>
    </HeaderContainer>
  );
}

export default Header;
